import React from "react";
import {
  StyleSheet,
  View,
  Text,
  TextInput,
  Button,
  Alert,
  ScrollView,
  ImageBackground,
  Image,
  TouchableOpacity,
} from "react-native";

export default class Start extends React.Component {
  render() {
    return <View style={styles.container}></View>;
  }
}
